import { Link } from 'react-router-dom';
import '../style/nav.scss';


export default function Navigation() {
    return (
        <nav className='nav'>
            <Link 
                to="/" 
                className={activePage === '/' ? 'link inactive-link' : 'link'} 
                onClick={() => handleClick('/')}
            >
                Accueil
            </Link>
            <Link 
                to="/apropos" 
                className={activePage === '/apropos' ? 'link inactive-link' : 'link'} 
                onClick={() => handleClick('/apropos')}
            >
                A propos
            </Link>
        </nav>
    )
};
